pragma solidity ^0.8.17;
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
error InvalidAddress();
error CannotTradeSameToken();
error TokenAndNFTAddressCannotBeEqual();
error CannotTradeWithSelf();
